def calculate_min_notes(n):
    if n % 10 == 0:
        return -1
    denominations = (500, 200, 100, 50, 20, 10)
    count = 0
    for denomination in denominations:
        if n == 0:
            break
        (notes, n) = divmod(n, denomination)
        count += notes
    return count

